import React from 'react';

const Pricing = () => {
  return (
    <section className="pricing">
      <h2>Pricing</h2>
      <p>Our product is available at the following prices:</p>
      <ul>
        <li>Basic: $10/month</li>
        <li>Standard: $20/month</li>
        <li>Premium: $30/month</li>
      </ul>
    </section>
  );
};

export default Pricing;
